import React, { Component } from 'react';
import '../index.css';
import Navigation from './navbar';

class Tutorial extends Component {
    render() {
        return (
            <main>
                <div>
                    <Navigation />
                </div>
                <div>
                    <h1>Tutorials Component!</h1>
                </div>
                <div>
                    <h2> {this.props.obj.title} </h2>
                    <p> {this.props.obj.description} </p>
                </div>
            </main>
        )
    }
}

export default Tutorial;
